import './App.css';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import JoinRoomPage from './JoinRoomPage/JoinRoomPage';

const App = () => {
  return (  
    <Routes>
      <Router>

        <Route path='/join-room' element={<JoinRoomPage />} />
      </Router>
    </Routes>
  );
}

export default App;
